import React from 'react'
import './Items.css'
import { CurrencyRupeeOutlined } from '@mui/icons-material'
import { BiCart, BiCartAlt } from 'react-icons/bi'
import data from '../../utils1/resto.json'

const Items = () => {

    const itemList = data.map((item)=>{
        if (item.items && item.items.length > 0) {
            item.items.forEach(subItem => {
              // Access properties of each sub-item here
              <div className='main1'>
              <img src={subItem.id} alt="food" className='item-img'/>
              <div className='main2 flexColCenter'>
                  <p className='item-name'>Pot Biryani</p>
                  <div className='flexCenter'>
                    <CurrencyRupeeOutlined/>
                    <p className='item-price'>250</p>
    
                  </div>
                  <button className='button'><BiCart className='item-cart'/></button>
             
    
           
            </div>
        </div>
            });
          }
        
        })
    
  return (
    <div className='main1'>
          <img src="" alt="food" className='item-img'/>
        <div className='main2 flexColCenter'>
              <p className='item-name'>Pot Biryani</p>
              <div className='flexCenter'>
                <CurrencyRupeeOutlined/>
                <p className='item-price'>250</p>

              </div>
              <button className='button'><BiCart className='item-cart'/></button>
         

       
        </div>
    </div>
  )
}

export default Items
